import React from 'react'
import { Link } from 'react-router-dom'

const Projects = () => {
  return (
    <div className='px-6 flex flex-col '>
    <div className='flex justify-center items-center flex-wrap '>
        {Array(6)
        .fill()
        .map((card,i) =>(
            <ProjectCard key={i} />
            ))}
    </div>

    </div>
  )
}

const ProjectCard = ({card, id}) =>(
    <div id='projects' className='rounded-lg shadow-lg bg-white w-64 m-4 '>
        <Link to={"/projects/" + id}>
            <img src="https://images.unsplash.com/photo-1721932547078-38a815bb6b17?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxmZWF0dXJlZC1waG90b3MtZmVlZHw3OHx8fGVufDB8fHx8fA%3D%3D" alt="Project Title" className=' rounded-xl h-64 w-full ' />
        </Link>
    </div>
)

export default Projects
